import Head from 'next/head'
import MainLAyout from '../components/Mainlayout'

export default function Home() {
  return (
    <MainLAyout>
      <Head>
        
      </Head>

      <main >
      <div className="homeContainer">
        <div className="bookingDetails">
            <div className="bookingDetail">
                <div className="bookingLabel">
                    <label for="text-input" className="labelText">Id</label>
                </div>

                <div className="bookingForm">
                    <input className="form-control" type="text" id="text-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div className="bookingLabel">
                    <label for="text-input" className="labelText">Text</label>
                </div>

                <div className="bookingForm">
                    <select className="custom-select">
                        <option selected>Status</option>
                        <option value="1">One</option>
                        <option value="2">Two</option>
                        <option value="3">Three</option>
                    </select>
                </div>
            </div>
            <div className="bookingDetail">
                <div className="bookingLabel">
                    <label for="text-input" className="labelText">Paid</label>
                </div>

                <div className="bookingForm">
                <select className="custom-select">
                        <option selected>Open this select menu</option>
                        <option value="1">One</option>
                        <option value="2">Two</option>
                        <option value="3">Three</option>
                    </select>
                </div>
            </div>
            <div className="bookingDetail">
                <div className="bookingLabel">
                    <label for="text-input" className="labelText">Receiver</label>
                </div>

                <div className="bookingForm">
                    <input className="form-control" type="text" id="text-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div className="bookingLabel">
                    <label for="text-input" className="labelText">Mobile</label>
                </div>

                <div className="bookingForm">
                    <input className="form-control" type="text" id="text-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div className="bookingLabel">
                <label for="example-date-input " className="labelText">Date</label>
                </div>

                <div className="bookingForm">
                <input className="form-control " type="date" id="example-date-input"/>
                </div>
            </div>
            <div className="bookingDetail">
                <div className="bookingLabel">
                    <label for="text-input" className="labelText">Cost</label>
                </div>

                <div className="bookingForm">
                    <input className="form-control form" type="text" id="text-input"/>
                </div>
            </div>
            
        </div>
        </div>
    
      </main>

      

      <style jsx>{`
       
       .bookingDetails{
           margin:1rem;
           display:flex;
           
       }
        @media screen and (max-width: 700px){
        .bookingDetails{
            
          margin:5px 0px;
        }
        }
       .bookingDetail{
           margin-left:10px;
           padding:30px 10px;
           display:flex;
           width:200px;
           flex-direction:column;
       }
       .bookingLabel{
            margin-left:10px;
            width:80px;
            
       }
       .form{
           border:none;
           border-bottom:3px solid gray;
       }    
       .labelText{
           margin:auto 0;
           font-size:24px;
           color:blue;  
       }
       .labelText:after{
           content:"";
           display:block;
           width:120px;
           height:3px;
           background-color:black;
       }
      

      `}</style>
    </MainLAyout>
  )
}
